@KramarenkoMari3 I'm from Finland. After Soviet Union collapsed I had a plan visit there some day. 
Well, that day never come and after their invasion into Ukraine it will never come.
Only if they try to come here, I will visit there with appropriate armament.

@AvgerinosMoscow Russia invaded Ukraine. That's not a civil war.

The early phase, fought between Russian backed rebels and the Ukrainian government, could be described as a civil war.

But Russia started a new phase when it launched it's full-scale invasion. Ukraine is fighting a defensive war.
